    "public-fishing-plan-and-environmental-assessment-prime-hook-national-wildlife-refuge-1986",nt"isopen":
    false,nt"url": null,nt"notes": "A new fishing plan has been prepared to
    update the refugeu2019s public fishing program and to provide a legal framework
    for refuge fishing. This plan is combined with an environmental assessment and a
    section 7 evaluation.   The refuge contains a sizable fishery resource which can
    be used for consumptive wildlife recreation. The objectives of this fishing plan
    are 1) To provide quality wildlife oriented recreation. 2) To provide for harvest
    of a renewable resource. 3) To minimize conflicts with the refuge' s primary objectives
